import { Route, Switch } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/quotes"><AllQuotes/></Route>
        <Route path="/quotes/:quoteId"></Route>
        <Route path='/new-quotes'></Route>
      </Switch>
    </div>
  );
}

export default App;
